response.activities:
Записывайтесь на нлп- саморазвитие и терапию. На данном тренинги у вас есть возможность получить много новой информации, и решить свои проблемы. В конце любого из 2х тренингов выдается свидетельство о прохождении курсов нлп
набор идет с сентября до конца ноября. места ограничены.
тренинг саморазвития
состоит из 8 циклов. 1 цикл(2 занятия) 2000тысячи. за привод людей скидка.

терапия состоит тоже из 8 циклов стоимость 2500
нлп-терапия выйдет на неделю позже.
за привод человека скидка 100рублей.

в течении наших тренингов у вас есть возможность приобрести такие знания и умения как:

- установить личные взаимоотношения и их улучшить;
- развить дар убеждения;
- перейти к позитивному мировосприятию
- повысить уровень самооценки;
-преодолеть последствия негативных переживаний прошлого
- сосредоточиться на намеченных целях и направит все силы на их достижения;
- действовать с максимальной производительностью;
- управлять своими ощущениями;
- согласовывать с намеченными целями свои убеждения и систему ценностей;
- избавиться от нежелательных привычек;
- верить в свои силы в любых начинаниях;
- добиваться того, что прежде казалось невозможным;
- достигать взаимопонимания с клиентами, заказчиками и коллегами
- творчески решать возникающие проблемы;
- получать удовольствие от того, что прежде вызывало страх;
- эффективнее распоряжаться своим временем;
- углубить и укрепить ощущения полноты жизни;
- выработать в себе те качества, которые восхищают вас в других;
- получать от жизни больше удовольствия.
- узнать нлп, как 1 из направлений в работе с клиентом.
- получить большой практический навык в области нлп.
